import React, { useEffect } from 'react';

import NavSearch from '../navSection/NavSearch';
import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const product ={
  name: 'jolof rice',
  desc: 'nigeria jolof',
  price: 1200,
  _id: 'kzd',
  kitchenName: 'iyah-dolof kitchen',
  kitchenRating: 3.5,
  verified: true,
  physicalAddress: '30 udeji street lagos island',
  status: 'available',
  content: ['2 portions of rice', '1 chicken lap'],
  img: 'https://cdn.filestackcontent.com/5ngAPL80SuCvpsEb7S2f',
}

function Product() {
  const params = useParams();
  const { id } = params;

  useEffect(() => {
    const productHandler = async () => {
      try {
        const { data } = await axios.get();
      } catch (error) {
        console.log(error);
      }
    };
  },[]);
  return (
    <div>
      <NavSearch />
      <Row>
        <Col className="product">
          <img src={product} alt="" />
          <div>
            {product.imgs.ma((item, index) => (
              <img src={item} alt="" key={index} />
            ))}
          </div>
        </Col>
        <Col></Col>
      </Row>
    </div>
  );
}

export default Product;
